import { useState } from "react";
import { ListHandleBox, ListHandleButtonBox } from "../styles/MyLists";
import { SerifTextN } from "../styles/TextStyles";
import { generateList } from "./functions/itemList";

export const MyListsElementBox = (data: any, setData: any) => {
  const [active, setActive] = useState<boolean>(false);
  return (
    <ListHandleBox theme={active}>
      <ListHandleButtonBox onClick={() => setActive(!active)}>
        <SerifTextN>xD</SerifTextN>
      </ListHandleButtonBox>
      <div>{active ? generateList(data.data, setData, "mode") : null}</div>
    </ListHandleBox>
  );
};
